import './App.css'; 
import Header from './components/Header';
import Movie from './components/Movie';
import movies from './movie.json'

function App() {

  let login = false;
  if(login == false){
    return <h1>No entry</h1>
  }



  return (
    <div className="App">
       <Header/>
       <div className="main">
       {
        movies.map((element,index) => {
          return(
        <Movie 
        key={index} 
        title ={element.Title} 
        year={element.Year}
        img={element.Poster}

         />
          )
       })
       }
       </div>
    </div>

  );
}

export default App;
